create table electronic_fence_vins
(
    id         int auto_increment
        primary key,
    setting_id int         null,
    vin        varchar(50) null,
    constraint `Index 3`
        unique (vin, setting_id)
)
    comment '实时监控-电子围栏车辆信息' collate = utf8mb4_bin;

create index FK_t_zd_electronic_fence_vins_t_zd_electronic_fence_setting
    on electronic_fence_vins (setting_id);

